import "./login.css";
import Input from "./components/input/input";
const login = (props) => {
    const handleStuInfo = (stuid, stuname) => {
        props.onStuInfo({stuid, stuname});
        return {stuid, stuname};
    };
    return (
        <div className="login-bg">
            <Input onStuInfo={handleStuInfo}/>
        </div>
    )
}
export default login;
